import React, { Component } from 'react';



export default class Quotes extends Component {
    render(){
        return(<div className="Quotes">
       <ul>
               <li> <h1>The meaning of life is that it stops.</h1></li>
               <li> <h1>It is often safer to be in chains than to be free.</h1></li>

              <li>  <h1>In the fight between you and the world, back the world</h1></li>
           <li>  <h1>One of the first signs of the beginning of understanding is the wish to die.</h1></li>
              <li>  <h1>Youth is happy because it has the ability to see beauty. Anyone who keeps the ability to see beauty never grows old.</h1></li>
                </ul>
         </div>
        )
    }
}
